import starIcon from "./images/icon-star.svg";
import { AccordionItemFAQ } from "./accordion-item-faq";
import { questionsAndAnswers } from "./questions-answers";

export const FAQCard = () => {
  return (
    <div className="card-base px-4 pt-5 pb-3">
      <div className="card-header d-flex flex-row mb-4 ms-3">
        <img src={starIcon} alt="Star icon" className="me-4" />
        <h1 id="card-title" className="fw-bold">
          FAQs
        </h1>
      </div>

      {questionsAndAnswers.map(({ question, answer }, index: number) => (
        <div className="mx-3">
          <AccordionItemFAQ question={question} answer={answer} />
          {index !== questionsAndAnswers.length - 1 && <hr className="my-1" />}
        </div>
      ))}
    </div>
  );
};
